import React, { Fragment, useEffect } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/layout/AppNavBar';
import Landing from './components/layout/Landing';
import Routes from './components/routing/Routes';
import Footer from './components/footer/Footer';

// Redux
import { Provider } from 'react-redux';
import store from './store';
import { loadUser } from './actions/auth';
import setAuthToken from './utils/setAuthToken';

import './App.css';

if (localStorage.token) {
  setAuthToken(localStorage.token);
}
var sectionStyle = {
  backgroundImage: `https://static.scientificamerican.com/sciam/cache/file/4E0744CD-793A-4EF8-B550B54F7F2C4406.jpg`,
};
const App = () => {
  useEffect(() => {
    store.dispatch(loadUser());
  }, []);

  return (
    <Provider store={store}>
      <Router>
        <div
          style={{
            backgroundImage: `url("https://static.scientificamerican.com/sciam/cache/file/4E0744CD-793A-4EF8-B550B54F7F2C4406.jpg")`,
            backgroundRepeat: 'no-repeat',

            color: 'white',
          }}
        >
          Nice Snippets
        </div>
        <Fragment>
          <div className='application'>
            <Navbar />
            <div className='container'>
              <Switch>
                <Route exact path='/' component={Landing} />
                <Route component={Routes} />
              </Switch>
            </div>

            <Footer />
          </div>
        </Fragment>
      </Router>
    </Provider>
  );
};

export default App;
